import React from 'react';

const LandingPage = () => {
  return (
    <div className="LandingPage">
      <h1>Daily Progress Tracker</h1>
      <p>Track your habits and stay consistent!</p>
      <button>Start Tracking</button>
    </div>
  );
};

export default LandingPage;
